import { useState } from "react"
import Table from "./bingTable"
import { GetAllEntries } from "./methods"

let entries;

const TableScreen = () => {
    const [showTable, setShowTable] = useState(false)
    return(
        <>
            <div className="col-sm">
                <button onClick={() => {updateEntries()}} className="btn btn-dark btn-lg w-100 h-100">Bing Table</button>
            </div>
            {(showTable !== false) && (
                <Table data={entries} rowsPerPage={100}/>
            )}
        </>
    )

    function updateEntries() {
        entries = (() => GetAllEntries())
        setShowTable(true)
    }
}

export default TableScreen
